import React from "react";
import { MapList } from "@semapps/geo-components";
import {
  listContext,
  ListContextProvider,
  useGetList,
  useGetMany,
  useGetOne,
} from "react-admin";
const Map = () => {
  const { ids, data, basePath } = useGetList("Place", {
    page: 1,
    perPage: 1000,
  });
  const listContext = useList({
    data,
    ids,
    basePath: "/resource",
    resource: "resource",
  });
  // const { data } = useGetList("Place");

  console.log({ ids, data, basePath });
  // console.log(data);
  return (
    <ListContextProvider value={listContext}>
      <MapList
        {...{ ids, data, basePath }}
        record={data}
        latitude={(record) => {
          console.log(record);
          return record?.["pair:hasPostalAddress"]?.["pair:latitude"];
        }}
        longitude={(record) =>
          record?.["pair:hasPostalAddress"]?.["pair:longitude"]
        }
        label={(record) => record?.["pair:label"]}
        description={(record) =>
          record?.["pair:hasPostalAddress"]?.["pair:label"]
        }
        scrollWheelZoom
      />
    </ListContextProvider>
  );
};
export default Map;
